function decodeImageFromBase64(base64String)
{
	var byteArray = android.util.Base64.decode(base64String, 0);
	return android.graphics.BitmapFactory.decodeByteArray(byteArray, 0, byteArray.length);
}

function resizeImageToFitScreen(image)
{
	// how this function resizes image: keep the height, remove pixels on the left and on the right

	var imageWidth = image.getWidth();
	var imageHeight = image.getHeight();
	var imageHeightScaled = displayHeight;
	var imageWidthScaled = imageHeightScaled * (imageWidth / imageHeight);

	if(imageWidthScaled > displayWidth)
	{
		var pixelsToBeRemoved = imageWidthScaled - displayWidth;
		var pixelsForEachSide = Math.floor(pixelsToBeRemoved / (imageWidthScaled / imageWidth) / 2);

		var matrix = new android.graphics.Matrix();
		matrix.postScale(imageWidthScaled / imageWidth, imageHeightScaled / imageHeight);

		var firstBitmap = new android.graphics.Bitmap.createBitmap(image, pixelsForEachSide, 0, image.getWidth() - (pixelsForEachSide * 2), image.getHeight());
		return new android.graphics.Bitmap.createBitmap(firstBitmap, 0, 0, firstBitmap.getWidth(), firstBitmap.getHeight(), matrix, true);
	} else
	{
		var matrix = new android.graphics.Matrix();
		matrix.postScale(imageWidthScaled / imageWidth, imageHeightScaled / imageHeight);

		return new android.graphics.Bitmap.createBitmap(image, 0, 0, image.getWidth(), image.getHeight(), matrix, true);
	}
}

function stringToBoolean(string)
{
	switch(string.toLowerCase())
	{
		case "true": case "yes": case "1": return true;
		case "false": case "no": case "0": case null: return false;
		default: return Boolean(string);
	}
}

function getSavedBoolean(name, defaultValue, debug)
{
	var savedDataTest = ModPE.readData(name);
	debug = debug || false;

	// debug code
	if(DEBUG1 && debug)
	{
		var debugTest;

		if(typeof savedDataTest == "boolean")
		{
			clientMessage(name + " is bool");
			debugTest = savedDataTest;
		}else
		{
			if(typeof savedDataTest == "string")
			{
				clientMessage(name + " is string");
				debugTest = stringToBoolean(savedDataTest);
			}
			else
			{
				clientMessage(name + " is " + typeof savedDataTest);
			}
		}

		clientMessage(name + ": " + debugTest);

		if(typeof debugTest == "boolean")
		{
			if(debugTest)
				clientMessage(name + " true");
			else
				clientMessage(name + " false");
		}else
		{
			clientMessage(name + ", something really wrong here!");
		}
	}

	// return the saved boolean
	if(typeof savedDataTest == "boolean")
	{
		return savedDataTest;
	}else
	{
		if(typeof savedDataTest == "string")
		{
			if(savedDataTest != "" && savedDataTest != null && savedDataTest != undefined)
			{
				return stringToBoolean(savedDataTest);
			}
			else
			{
				// this setting has never been saved.
				if(typeof defaultValue == "boolean")
					return defaultValue;
				else
					return stringToBoolean(defaultValue)
			}
		}else
		{
			clientMessage("Error in getSavedBoolean() for " + name);
			return false;
		}
	}
}
